aliza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"54707","type":"Paragraph"},{"attributes":{"data_source":{"id":"54549"},"glyph":{"id":"54550"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"54551"},"selection_glyph":null,"view":{"id":"54553"}},"id":"54552","type":"GlyphRenderer"},{"attributes":{"data_source":{"id":"54589"},"glyph":{"id":"54590"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"54591"},"selection_glyph":null,"view":{"id":"54593"}},"id":"54592","type":"GlyphRenderer"},{"attributes":{"text":"Taxa de Crescimento = 2.9893"},"id":"54705","type":"Paragraph"},{"attributes":{"data":{"x":{"__ndarray__":"AACAsOwHd0IAAEAWPwh3QgAAAHyRCHdCAADA4eMId0IAAIBHNgl3QgAAQK2ICXdCAAAAE9sJd0IAAMB4LQp3QgAAgN5/CndCAABARNIKd0IAAACqJAt3QgAAwA93C3dCAACAdckLd0IAAEDbGwx3QgAAAEFuDHdCAADApsAMd0IAAIAMEw13QgAAQHJlDXdCAAAA2LcNd0IAAMA9Cg53QgAAgKNcDndCAABACa8Od0IAAABvAQ93QgAAwNRTD3dCAACAOqYPd0IAAECg+A93QgAAAAZLEHdCAADAa50Qd0IAAIDR7xB3QgAAQDdCEXdCAAAAnZQRd0IAAMAC5xF3QgAAgGg5EndCAABAzosSd0IAAAA03hJ3QgAAwJkwE3dCAACA/4ITd0IAAEBl1RN3QgAAAMsnFHdCAADAMHoUd0IAAICWzBR3QgAAQPweFXdCAAAAYnEVd0IAAMDHwxV3QgAAgC0WFndCAABAk2gWd0IAAAD5uhZ3QgAAwF4NF3dCAACAxF8Xd0IAAEAqshd3QgAAAJAEGHdCAADA9VYYd0IAAIBbqRh3QgAAQMH7GHdCAAAAJ04Zd0IAAMCMoBl3QgAAgPLyGXdCAABAWEUad0IAAAC+lxp3QgAAwCPqGndCAACAiTwbd0IAAEDvjht3QgAAAFXhG3dCAADAujMcd0IAAIAghhx3QgAAQIbYHHdCAAAA7Codd0IAAMBRfR13QgAAgLfPHXdCAABAHSIed0IAAACDdB53QgAAwOjGHndCAACAThkfd0IAAEC0ax93QgAAABq+H3dCAADAfxAgd0IAAIDlYiB3QgAAQEu1IHdCAAAAsQchd0IAAMAWWiF3QgAAgHysIXdCAABA4v4hd0IAAABIUSJ3QgAAwK2jIndCAACAE/Yid0IAAEB5SCN3QgAAAN+aI3dCAADARO0jd0IAAICqPyR3QgAAQBCSJHdCAAAAduQkd0IAAMDbNiV
